import React from "react";
import Button from './loginbutton';

function Logincard() {
  return (
    <div className="login-card">
      <div class="logingrid">
          <Button/>
        <div class="login-heading"></div>
        <div class="login-form"></div>
      </div>
    </div>
  );
}

export default Logincard;
